import Link from "./components/link";
import { colors } from "./themes";

export const Footer = () => {
  return (
    <div style={{ fontSize: "11px", textAlign: "center" }}>
      Challenge by{" "}
      <Link href="https://www.frontendmentor.io?ref=challenge" name="Frontend Mentor" />
      . Coded by
      <Link href="https://github.com/ShawenHarker" name="Shawen Harker" />.
       <a 
        rel="noreferrer"
        href="https://github.com/ShawenHarker"
        target="_blank"
        style={{color: colors.link, textDecoration: "none"}}
        >
            Shawen Harker
        </a>.
    </div>
  );
};
